import { useState } from "react";
import "../App.css";

export default function userLogin() {
  const [count, setCount] = useState(0);

  return (
    <div className="userLogin">
      <button
        onClick={() => {
          setCount(count + 1);
        }}
      >
        Get Request
      </button>
    </div>
  );
}
